INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(2, 'camiseta negra', 'Tres Camisetas básicas para hombre Oversize color negro en tela 100% algodón, cuello en tela RIB; más suave, elástico y con superficie acanalada. Modelo usa talla L. Se recomienda usar una talla menos en comparación a una talla convencional.  Prenda en promoción o descuento no cuenta con cambio por gusto o talla.', 70000, 100, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:51:42', '2025-10-18 02:18:44'),
(3, 'camisetas', 'Tres camisetas básicas para hombre Silueta Oversize, color Verde Botella, Blanco y Negro. Tela algodón, su talla y mangas son extra grandes. Cuello en tela RIB; más suave, elástico y con superficie acanalada.  Se recomienda usar una talla menos en comparación a una talla convencional. Prenda en promoción o descuento no cuenta con cambio por gusto o talla.', 75, 150, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:53:25', '2025-09-23 19:53:25');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(4, 'duos de camisetas', 'Este Duo Pack de camisetas básicas alto gramaje está diseñado para quienes valoran el balance perfecto entre estructura, minimalismo y durabilidad. Confeccionadas en 100% algodón premium de 270g, ofrecen una textura firme, una caída impecable y resistencia superior al desgaste. Incluye dos tonos esenciales: blanco clásico y camel neutro, ideales para un look limpio, versátil y con actitud urbana. Perfectas para llevar solas, estas camisetas son un básico elevado a otro nivel.', 75, 120, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:55:08', '2025-09-23 19:55:08');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(5, 'camiseta blanca con diseño', 'Camiseta oversize en algodón peruano premium (gramaje 190-220), con gráfico exclusivo “Sativa Spirit” estampado en alta definición. Corte amplio que potencia el flow urbano sin perder comodidad. Diseño icónico que eleva tu esencia.', 80, 100, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:56:37', '2025-09-23 20:20:09');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(6, 'camiseta ', 'Camiseta oversize acid wash en algodón peruano 100% de alto gramaje (190–220 g), con lavado artesanal que le da un acabado único. Estampado trasero estilo gótico con alas de acero y el sello “Once you get in, you won’t want to get out”. Streetwear con alma rebelde y diseño fuera de este plano.', 85, 100, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:58:09', '2025-09-23 20:20:21');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(7, 'camiseta', 'Camiseta Semi Oversize Estampado Retro 05561', 80, 80, '', 'null', 'dynamo', 1, 4, '2025-09-23 19:58:54', '2025-09-23 19:58:54');
