(8, 'camiseta', 'Camiseta oversize de alto impacto gráfico, confeccionada en algodón peruano con gramaje de 190-220 g. Su diseño frontal y trasero con estampado tipo tatuaje y acabado nítido le da una estética psicodélica que rompe esquemas. Ideal para quienes buscan calidad y estilo sin perder comodidad.', 90, 80, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:00:22', '2025-09-23 20:00:22');
