(9, 'sudadera', 'Sudadera Dynamo en algodón de alto gramaje, con fit relajado y estampado lateral en alto contraste. Una prenda diseñada para moverse con actitud, pensada para la calle y el día a día sin perder esencia urbana.', 90, 70, '', 'null', 'dynamo', 2, 23, '2025-09-23 20:02:11', '2025-09-23 20:05:04');
