(10, 'pantalon marron ', 'Sudadera Dynamo en algodón de alto gramaje, con fit relajado y estampado lateral en alto contraste. Una prenda diseñada para moverse con actitud, pensada para la calle y el día a día sin perder esencia urbana', 90, 70, '', 'null', 'dynamo', 2, 22, '2025-09-23 20:04:35', '2025-09-23 20:20:35');
