(11, 'jeans baggy', 'Jeans Baggy Básico en denim rígido de alto gramaje, pensado para quienes buscan un fit relajado y auténtico. Su base textil rígida asegura durabilidad, mientras el diseño minimalista mantiene la esencia streetwear de Dynamo. Perfecto para elevar tu estilo urbano con comodidad y actitud', 90, 60, '', 'null', 'dynamo', 2, 19, '2025-09-23 20:06:41', '2025-09-23 20:06:41');
