(12, 'pantaloneta', 'Pantaloneta diseñada para brindar frescura y resistencia. Su fit relajado con detalles en contraste y pretina ajustable asegura estilo urbano con comodidad total. Perfecta para combinar con camisetas oversize y elevar cualquier look streetwear. ', 60, 50, '', 'null', 'dynamo', 2, 26, '2025-09-23 20:12:42', '2025-09-23 20:12:42');
