(13, 'pantaloneta casual', 'Bermuda regular negra en tela rígida, con bolsillos funcionales y pretina elástica para máxima comodidad sin perder flow. Diseño urbano, resistente y versátil, pensada pa’ el parche, el día a día o lo que venga. Dynamo vibes en cada costura.', 60, 50, '', 'null', 'dynamo', 2, 26, '2025-09-23 20:14:07', '2025-09-23 20:14:07');
