(14, 'pantalon jean rojo', 'Bermuda tipo jorts rígida en denim lavado rojo intenso, con estructura oversized y costuras en contraste que elevan el estilo urbano. Diseñada para destacar en cada movimiento, combinando actitud callejera con la solidez de una base textil rígida. ', 70, 50, '', 'null', 'dynamo', 2, 26, '2025-09-23 20:16:09', '2025-09-23 20:16:09');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(15, 'pantaloneta de algodon', 'Domina el juego con la pantaloneta Elite Varsity, una pieza que mezcla estilo y comodidad en cada movimiento. Confeccionada en malla transpirable y un diseño inspirado en la esencia del streetwear deportivo, incorpora detalles contrastantes y un fit relajado para que te sientas imparable dentro y fuera de la cancha', 60, 50, '', 'null', 'dynamo', 2, 26, '2025-09-23 20:17:54', '2025-09-23 20:17:54');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(16, 'camiseta', 'Camiseta negra para hombre oversize con estampado, tela algodón, cuello en tela Rib, silueta amplia, textura lisa, una prenda versátil infaltable en tu closet, úsala con jeans de diferentes estilos, pantalonetas o bermudas. Modelo usa talla L. Se recomienda usar una talla menos en comparación a una talla convencional. *No incluye accesorios ni prendas adicionales', 50, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:32:00', '2025-09-23 20:32:00');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(17, 'camisilla', 'Camiseta sin mangas regular para hombre con un diseño imponente que fusiona el estilo biker y la esencia del rock. Su gráfico cargado de energía y actitud es el statement perfecto para quienes viven sin límites', 60, 1, '', 'null', 'dynamo', 1, 8, '2025-09-23 20:33:08', '2025-09-23 20:33:08');
