(18, 'camiseta', 'Camiseta para hombre oversize con estampado , tela algodón, cuello en tela Rib, silueta amplia, textura lisa, una prenda versátil infaltable en tu closet, úsala con jeans de diferentes estilos, pantalonetas o bermudas. Modelo usa talla L. Se recomienda usar una talla menos en comparación a una talla convencional. *No incluye accesorios ni prendas adicionales.', 40, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:34:00', '2025-09-23 20:34:00');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(19, 'camiseta', 'La Camiseta Acid Wash \"Raw Stains\" redefine lo vintage con un toque rebelde. Con un efecto lavado impactante que deja manchas irregulares únicas, esta prenda de algodón premium captura la esencia del streetwear auténtico. Ideal para quienes buscan un look desgastado pero con estilo, perfecto para destacar en cada outfit  ', 80, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:34:37', '2025-09-23 20:34:37');
