(20, 'camiseta', 'Un tributo a la leyenda, fusionando un diseño vintage streetwear con un efecto acid wash de manchas irregulares que le da una vibra auténtica y desgastada. Su gráfica impactante rinde homenaje a un ícono del hip-hop, perfecta para los que llevan la cultura en su ADN. El acabado envejecido y los detalles en alto contraste la convierten en una pieza clave del estilo urbano retro', 70, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:35:57', '2025-09-23 20:35:57');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(21, 'camiseta negra con diseño', 'Camiseta de silueta oversize, elaborada en algodón peruano 100% de alto gramaje (190-220 g/m²), lo que garantiza una caída estructurada, mayor durabilidad y una textura suave al tacto. Cuenta con cuello ribeteado reforzado, costuras dobles para mayor resistencia y un estampado gráfico en serigrafía de alta calidad tanto en el pecho como en la espalda, con excelente definición y fijación al lavado. Su corte amplio ofrece libertad de movimiento y un fit urbano ideal para looks relajados pero con carácter.', 85, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:38:10', '2025-09-23 20:38:10');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(22, 'camiseta con diseño', 'Camiseta oversize confeccionada en algodón peruano de gramaje (190–220 g/m²), lo que le da una caída firme, tacto suave y excelente durabilidad. Presenta un estampado estilo aerografía con imagen frontal de una virgen doliente en tonos marrón degradado, lo que le aporta un look callejero con carga emocional y estética chicana. Su corte holgado, cuello reforzado y detalles de teñido manual en cuello, mangas y dobladillo la convierten en una pieza única con actitud rebelde y mística, pensada para quienes visten arte en la piel.', 100, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:40:31', '2025-09-23 20:40:31');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(23, 'camiseta blanca con diseño', 'Camiseta oversize hecha con algodón peruano  (190-220 g/m²), diseñada para brindar estructura sin perder comodidad. Su estampado gráfico en espalda y frente fusiona arte y rebeldía con un mensaje poderoso. Una prenda con ADN urbano y espíritu atemporal, perfecta para quienes llevan su historia en la piel y en su estilo.', 85, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:42:12', '2025-09-23 20:42:12');
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `imagenes`, `marca`, `id_categoria`, `id_subcategoria`, `fecha_creacion`, `ultima_actualizacion`) VALUES
(24, 'camiseta con diseño', 'Camiseta oversize en algodón peruano 100% de alto gramaje (190-220 g), ideal pa&#039; romper esquemas con estilo. Diseño gráfico “Holy Green” que mezcla lo sagrado y lo callejero en una sola vibra. Corte relajado, estampado nítido y actitud sin filtros. Streetwear con mensaje.', 80, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:54:52', '2025-09-23 20:54:52');
