(25, 'camiseta con diseño', 'Camiseta oversize elaborada en algodón peruano de gramaje medio (190-220), con tacto suave y caída estructurada. Su gráfico trasero tipo ilustración renacentista fusionado con la estética urbana y el mensaje “Legalize” la convierte en una pieza statement. Ideal para quienes quieren vestir con actitud y concepto sin perder comodidad ni estilo.', 90, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:56:25', '2025-09-23 20:56:25');
