(27, 'camiseta con diseño', 'Camiseta acid wash en tono cielo con efecto marmoleado único, confeccionada en 100% algodón de alto gramaje (190g - 220g aprox.) que asegura estructura, durabilidad y caída premium. Diseño oversized con estampado gráfico en alta definición tipo ilustración celestial, combinando simbología angelical y calaveras con tipografía gótica. Una pieza que desafía lo convencional y eleva tu statement visual en el streetwear contemporáneo.  ', 100, 1, '', 'null', 'dynamo', 1, 4, '2025-09-23 20:58:12', '2025-09-23 20:58:12');
